import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file with reduced timeout
    await page.goto(fileUrl, { timeout: 15000 });
    await page.waitForLoadState('domcontentloaded');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on profile link using text content
    await page.waitForSelector('a:has-text("Your Profile")', { timeout: 10000 });
    await page.click('a:has-text("Your Profile")');

    // Wait for profile page to load
    await page.waitForSelector('.profile-page', { timeout: 10000 });
    await page.waitForTimeout(1000); // Additional wait for content to render

    // Take screenshot of profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile.png'));

    // Extract profile information
    const profileData = await page.evaluate(() => {
      const profileHeader = document.querySelector('.profile-header');
      if (!profileHeader) return null;

      return {
        fullName: profileHeader.querySelector('h2')?.innerText,
        username: profileHeader.querySelector('.username')?.innerText,
        bio: profileHeader.querySelector('.bio')?.innerText,
        totalOrders: profileHeader.querySelectorAll('.stat-number')[0]?.innerText,
        totalReviews: profileHeader.querySelectorAll('.stat-number')[1]?.innerText,
        sellerRating: profileHeader.querySelectorAll('.stat-number')[2]?.innerText,
        profileImage: profileHeader.querySelector('.profile-image')?.src
      };
    });

    if (!profileData) {
      throw new Error('Profile data not found');
    }

    return {
      success: true,
      action: "Successfully harvested user profile information",
      extractedData: profileData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to harvest user profile information",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
